ul {
  list-style: none;
  margin: 0;
  padding: 0;
}
.index {
  z-index: 10;
  width: 100%;
  min-width: 480px;
  height: 100%;
  background: #F6F8FF;
  padding: 15px;
  position: relative;
  display: flex;
  flex-flow: row nowrap;
  justify-content: space-between;
}
.index .tablea {
  width: 100%;
  height: 100%;
  background: rgba(255,255,255,1);
  box-shadow: 0px 0px 25px 0px rgba(63,106,255,0.08);
  border-radius: 6px;
  padding: 30px;
  position: relative;
}
.addBtn{
  position: absolute;
  right: 30px;
}
.table_box {
  width: 100%;
  height: calc(100% - 45px);
  margin-top: 45px;
}
.tables {
  width: 100%;
  max-height: calc(100% - 20px -30px);
}
.pages {
  margin-top: 20px;
  height: 30px;
  float: right;
  margin-right: 15px;
}
